(function(){describe("_.indexOfObject",function(){return beforeEach(function(){return this.objArray=[{a:1,b:1},{a:2,b:2},{a:5,b:3},{a:3,b:3}]}),it("finds first element",function(){var t;return t=_.indexOfObject(this.objArray,{a:1,b:1}),expect(t).toEqual(0)}),it("finds element beginning",function(){var t;return t=_.indexOfObject(this.objArray,{a:2,b:2}),expect(t).toEqual(1)}),it("finds last element",function(){var t;return t=_.indexOfObject(this.objArray,{a:5,b:3}),expect(t).toEqual(2)}),it("finds last element",function(){var t;return t=_.indexOfObject(this.objArray,{a:3,b:3}),expect(t).toEqual(3)}),it("find no element",function(){var t;return t=_.indexOfObject(this.objArray,{a:4,b:3}),expect(t).toEqual(-1)})})}).call(this);